import './App.css';
import Navbar from './components/navbar';
import Slider from './components/slider';
import SocialInfo from './components/socialInfo';
function App() {
  return (
    <div className="App">
      <Navbar />
      <Slider />
      <main>
        <SocialInfo />
      </main>
    </div>
  );
}

export default App;
